import "./App.css";

function App() {
  return (
    <form name="calc" className="calculator">
      <input type="text" placeholder="0" class="value" name="txt" readonly="" />
      <span onClick={() => (document.calc.txt.value += "7")}>7</span>
    </form>
  );
}

export default App;
